import React from 'react';

function About() {
    return (
        <section class="about">
            <h1 id="about">A little about me</h1>
            <p>Trying to grow and learn what is doesn't see to be impossible.
                Student from UCF bootcamp learning through the process of coding with company edx.
                Learning through the process of coding with company edx.
            </p>
        </section>
    );
}

export default About;
